import React from "react";
import "../styles/bottombar.css";

var array = ["Kingdom Hearts III", "The Walking Dead", "God of War"];

function listArray(){
    return array.map((arrayItem, token)=><p key = {token}>{arrayItem}</p>);
}

function BottomBar() {
    return ( 
        <div className = "bottomBar">
            <p>{listArray}</p>
        </div>
    );
}

export default BottomBar;
